import React from 'react';
import PropTypes from 'prop-types';
import clsx from 'clsx';
import {
  Box,
  Button,
  Card,
  CardContent,
  // CardHeader,
  Divider,
  Grid,
  makeStyles,
  // TextField,
} from '@material-ui/core';
import Typography from '@material-ui/core/Typography';
import InputBase from '@material-ui/core/InputBase';
import BorderColorIcon from '@material-ui/icons/BorderColor';
import DeleteIcon from '@material-ui/icons/Delete';

const useStyles = makeStyles(({
  root: {},
  item: {
    display: 'flex',
    flexDirection: 'column'
  }
}));

const Notifications = ({ className, ...rest }) => {
  const classes = useStyles();

  return (
    <form
      className={clsx(classes.root, className)}
      {...rest}
    >
      <Card>
        {/* <CardHeader
          subheader="Manage the notifications"
          title="Notifications"
        /> */}
        <Divider />
        <CardContent>
          <Grid
            container
            spacing={6}
            wrap="wrap"
          >
            <Grid
              className={classes.item}
              item
              // col
              // md={6}
              // sm={6}
              // xs={6}
            >

              <InputBase
                margin="normal"
                defaultValue="MyFirstProject"
                color="primary"
                inputProps={
                    {
                      style: {
                        fontSize: 30
                      }
                    }
                  }
                InputLabelProps={
                    {
                      style: {
                        fontSize: 30
                      }
                    }
              }
              />
            </Grid>
            <Grid>
              <Box mt={4}>
                <BorderColorIcon />
                <DeleteIcon />
              </Box>
            </Grid>
            <Grid className={classes.item} item md={12} sm={12} xs={12}>
              <Typography variant="h6" color="secondary">TODI</Typography>
              <Box mt={0}>
                <Typography variant="h6" color="secondary">No task</Typography>
              </Box>
            </Grid>
            <Grid className={classes.item} item md={12} sm={12} xs={12}>
              <Typography variant="h6" color="secondary">COMPLETED</Typography>
              <Box borderBottom={1} mt={0}>
                <Typography variant="h6" color="secondary">No task</Typography>
              </Box>
            </Grid>
          </Grid>
        </CardContent>
        <Divider />
        <Box
          display="flex"
          justifyContent="flex-end"
          p={2}
        >
          <Button
            color="primary"
            variant="contained"
          >
            Save
          </Button>
        </Box>
      </Card>
    </form>
  );
};

Notifications.propTypes = {
  className: PropTypes.string
};

export default Notifications;
